import React from "react";
import { Col, Container, Row } from "react-bootstrap";

function App() {
  return (
    <div className="App">
      <Container>
        <Row className="justify-content-md-center">
          <Col lg={3}>
          <h1>Hello World!</h1>
          </Col>
          <Col lg={3}>
          <h1>Hello World!</h1>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
